      for (      String file : listing) {
        String subResource=fileName + "/" + file;
        URL url2=getValidClassLoaderResource(cl,subResource);
        if (url2 == null) {
          throw new VertxException("Invalid resource: " + subResource);
        }
        unpackFromFileURL(url2,subResource,cl);
      }
    }
  }
  return cacheFile;
}
